def solve(nums):
    if len(nums) == 0:
        return -1
    majority = nums[0]
    count = 1
    for i in range(1, len(nums)):
        if nums[i] == majority:
            count += 1
        else:
            count -= 1
        if count == 0:
            majority = nums[i]
            count = 1
    count = 0
    for num in nums:
        if num == majority:
            count += 1
    if count > len(nums) // 2:
        return majority
    else:
        return -1

