def solve(arr):
    n = len(arr)
    if n == 0:
        return -1
    elif n == 1:
        return arr[0]
    else:
        majority = n // 2
        count = 1
        for i in range(1,n):
            if arr[i] == arr[i-1]:
                count += 1
            else:
                count = 1
            if count > majority:
                return arr[i]
        return -1
